A aurora boreal ocorre sempre que uma grande quantidade de elétrons provenientes dos ventos solares interage com elementos da atmosfera terrestre em uma grande velocidade. Tal interação provoca um forte choque entre as moléculas, fazendo com que seja produzido um fotão luminoso, cuja cor depende do comprimento de onda gerado pelas partículas envolvidas nesse processo.

Além do mais, as auroras polares ocorrem somente nas áreas de elevada latitude em razão da força do campo magnético da Terra. O que acontece é que os ventos solares carregados de elétrons movem-se a cerca de 1,6 milhões de km/h e, quando chegam ao nosso planeta, acabam sendo facilmente guiados pela força magnética gerada pelo núcleo terrestre, seguindo para as áreas polares. Nesse momento, parte do vento solar é captada pela ionosfera – camada superior da atmosfera –, sendo conduzida e acelerada em uma espécie de “túnel magnético” que se forma, o que ocasiona a geração dos efeitos de luzes quando há uma interação desse vento solar eletricamente carregado com os gases atmosféricos.
Existem auroras boreais de diversas cores, que dependem do tipo de gás ou molécula que participou dessa interação com os elétrons provenientes dos ventos solares. O oxigênio, a depender da altitude em que o fenômeno acontece, pode gerar auroras boreais verdes ou vermelhas; já o nitrogênio, também a depender da altitude, poderá gerar auroras azuis, púrpuras ou violetas.
